import React, { Fragment } from 'react';

import Header from '../Header';
import Proclaim from '../../assets/graphics/proclaim@2x.jpg';
import JoinUs from '../../assets/graphics/join-service@2x.jpg';

import { Container, Row, Col, Image } from 'react-bootstrap';
import './style.css';

const Home = () => {
  return (
    <Fragment>
      <Header />
      <Container>
        <Row>
          <Image id='join-us' src={JoinUs} alt='Service times and location' />
        </Row>
        <Row>
          <Image
            id='proclaim'
            src={Proclaim}
            alt='Pastor Joel proclaiming the name of Jesus'
          />
        </Row>
      </Container>
    </Fragment>
  );
};

export default Home;

